import React from 'react' 


const Nav = () => {

    // const aboutNav = (
    //     <div>about</div>
    // )

    // const fullNav = (
    //     <div>full</div>
    // )


    switch (window.location.pathname){
        case "/":
            return null
        case "/contact" || "/projects":
            return <div>hello</div>
        case "/about":
            return <h1>hello world</h1>
            default:
                return null
    }

    return (
        <div>
            Nav
        </div>
    )
}

export default Nav
